import React, { Component } from 'react';
import Icon from "../Atoms/Icon/Icon";
class MenuItem extends Component {
    render() {
        return (
            <>
                <li className="listItems">
                    <Icon icon={this.props.item.icon}/>
                    
                    {this.props.item.title}
                </li>
            </>
        );
    }
}

export default MenuItem;
